import banner from "../../images/banner.svg";
import "./login.css";

export const Login = () => {
  return (
    <div className="Login">
      <div className="bannerImageWrapper">
        <img className="bannerImage" src={banner} />
      </div>
      {/* <h1>Login</h1>
      <NavLink to="/">home</NavLink> */}
    </div>
  );
};
